import React from 'react'
import Template from './Template/Template';
import br from '../bg image.jpg'

/**
* @author
* @function TemplateTesting
**/

const TemplateTesting = (props) => {
    return (
        <Template
            src={br}
            title="milk"
            description="this is image"
            price="$200"
        />
    )

}

export default TemplateTesting
